import React from 'react';
import { Image, ScrollView, Text, View } from 'react-native';
import Constants from "expo-constants"
import { AntDesign } from '@expo/vector-icons';
import { Entypo } from '@expo/vector-icons';
const data = {
  avatar: '',
  name: '',
  description: '',
  photos: 100,
  follower: 100,
  following: 100,
  images: []
}

const styles = {
  container: {
    height: '100%',
    marginTop: Constants.statusBarHeight,
    padding: 30
  },
  navbar: {
    
  }
}

const FirstAssignment = () => {
  return (
    <ScrollView>
      <View style={styles.container}>
        <View style={{
          flexDirection: 'row',
          justifyContent: 'space-between',
          alignItems: 'center'
        }}>
          <AntDesign name="arrowleft" size={24} color="#747FA6" />
          <Entypo name="dots-three-horizontal" size={24} color="#747FA6" />
        </View>
        <View style={{
          flexDirection: 'row',
          justifyContent: 'center',
          paddingVertical: 30
        }}>
          <View style={{
            flex: 1,
            paddingRight: 60
          }}>
            <Image source={{
              uri: 'https://images.unsplash.com/photo-1589195731142-604fe7f3e915?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=755&q=80'
            }} style={{
              width: 120,
              height: 120,
              borderRadius: 100
            }} />
          </View>
          <View style={{
            flex: 1,
          }}>
            <Text style={{
              fontWeight: 'bold',
              fontSize: 20
            }}>Khanh Nguyen</Text>
            <Text style={{
              color: '#c1c4d5',
              marginVertical: 15,
              fontSize: 17
            }}>
              Developer
            </Text>
          </View>
        </View>
      </View>
    </ScrollView>
  );
};

export default FirstAssignment;
